import {doPostAsync} from "../api";
import {ip, tomcatPort} from "../../misc/constants";
import authHeader from "../user/auth-header";

const postPendingSession = (chargerId) => {
    doPostAsync(`http://${ip}:${tomcatPort}/api/charger/postPendingSession`, {chargerID: chargerId}, authHeader()).then(x => {
        console.log(x);
    }).catch(error => {
        console.log(error.response);
    })
}

export default postPendingSession;
